import './App.css';
import Navbar from './components/navbar';
import Home from './components/home';
import Login from './components/login';
import Register from './components/register';
import Betting_Rules from './components/how_to_bet';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
function App() {
  return (
    <>
    <Navbar/>
    <Router>
      <Switch>
          <Route path="/home">
            <Home/>
          </Route>
          <Route path="/Login">
            <Login/>
          </Route>
          <Route path="/Register">
            <Register/>
          </Route>
          <Route path="/Betting-Rules">
            <Betting_Rules/>
          </Route>
          <Route path="/">
            <Home/>
          </Route>
      </Switch>
    </Router>
    {/* <Home/> */}
    {/* <Login/> */}
    {/* <Register/> */}
    {/* <Betting_Rules/> */}
    </>
  );
}

export default App;
